INSERT INTO `tblShows` (`show_id`, `type_id`, `title`, `date_added`, `year_of_release`, `duration`, `description`) VALUES
(247747, 1, 'Amar Akbar Anthony', '43830', 1977, '172', 'Abandoned in a park by their father, Amar, Akbar and Anthony grow up independently and have no knowledge of one another. They\'re reunited as adults when, by coincidence, they all give blood at the same hospital.'),
(269880, 1, 'Bad Boys', '43739', 1995, '119', 'In this fast-paced actioner, two Miami narcotics cops are hot on the trail of a master crook who has snatched $100 million worth of heroin.'),
(281550, 1, 'La Bamba', '43831', 1987, '109', 'The plane crash that killed Buddy Holly also took Ritchie Valens, whose modest upbringing and rise to fame are depicted in this exhilarating biopic.'),
(284890, 1, 'Barsaat', '43191', 1995, '166', 'A naïve young man and a rich city girl fall in love. Her stepfather, however, doesn\'t approve of the match and will stop at nothing to split the pair.'),
(292118, 1, 'Beavis and Butt-head Do America', '43789', 1996, '81', 'After realizing that their boob tube is gone, Beavis and Butt-head set off on an expedition that takes them from Las Vegas to the nation\'s capital.'),
(296682, 1, 'Benji', '43165', 1974, '86', 'After lovable abandoned mutt Benji is adopted by a kind family, he chases cats, flirts with a show dog and bravely helps to rescue two abducted kids.'),
(347365, 1, 'Candyman', '43739', 1992, '99', 'Grad student Helen Lyle unintentionally summons the Candyman, a hook-handed creature made flesh by other people\'s belief in him.'),
(352989, 1, 'Carrie', '43617', 1976, '98', 'An outcast teen with telekinetic ability lashes out with her deadly power when the high school \"in crowd\" torments her with a sick joke at the prom.'),
(372195, 1, 'Child\'s Play', '43830', 1988, '87', 'When a rash of murders unfolds, 6-year-old Andy knows that his toy doll Chucky is the killer, but neither his mom nor the cops believe him.'),
(374651, 1, 'Chitty Chitty Bang Bang', '43831', 1968, '146', 'Quirky inventor Caractacus Potts and his family travel in their magical flying car to Vulgaria, a kingdom strangely devoid of children.'),
(382650, 1, 'Cleopatra Jones', '43770', 1973, '89', 'A stylin\' special agent chases down drug lords and does her part to stop trafficking. Soon, she finds herself seeking revenge on a dealer.'),
(404067, 1, 'The Craft', '43831', 1996, '101', 'At a Catholic school, a new girl falls in with a clique of teen witches who wield their powers against anyone who crosses them, even their parents.'),
(408911, 1, 'The Crow', '43466', 1994, '102', 'One year after Eric Draven and his fiancée are murdered, Draven – watched over by a hypnotic crow – returns from the grave to exact revenge.'),
(419733, 1, 'The Dark Crystal', '43586', 1982, '93', 'In this mythical tale, Jen, the last of the Gelfling race, is charged with healing the Crystal of Truth after its mutilation sets off an era of terror.'),
(449931, 1, 'Doctor Zhivago', '43770', 1965, '200', 'A young physician and his beautiful mistress get swept up in the danger and drama of the Bolshevik Revolution in this Oscar-winning epic.'),
(484369, 1, 'The Evil Dead', '43840', 1981, '85', 'During a stop at a remote cabin deep within the woods, a group of teens begins turning into flesh-eating zombies in director Sam Raimi\'s cult classic.'),
(485218, 1, 'Executive Decision', '43770', 1996, '133', 'When terrorists hijack a 747 and turn it into a nerve gas bomb aimed at Washington, D.C., commandos use an experimental plane to try to stop them.'),
(498716, 1, 'Ferris Bueller\'s Day Off', '43833', 1986, '103', 'Ferris convinces his entire school he\'s at death\'s door, then hits the streets of Chicago with his girlfriend and best friend for a day of fun.'),
(506464, 1, 'The First Wives Club', '43789', 1996, '103', 'Following a friend\'s suicide after her husband dumps her for a younger model, three women plot payback against their two-timing exes.'),
(510854, 1, 'The Flintstones', '43739', 1994, '91', 'The Flintstones hit the big screen in this live-action comedy that finds Fred and Barney struggling to cope with the pressures of work and family.'),
(516154, 1, 'For the Love of Benji', '43165', 1977, '84', 'Benji and his owner get separated in Greece. On his quest to find them, he\'s targeted by various bad guys who want to get their hands on him.'),
(516788, 1, 'Forbidden Planet', '43770', 1956, '98', 'A pulp-fiction sci-fi classic, Forbidden Planet stars Leslie Nielsen as a heroic starship captain who finds the paradise planet Altair-IV.'),
(520489, 1, 'Four Weddings and a Funeral', '43678', 1994, '118', 'A commitment-phobic Brit tries to reconnect with an alluring American who\'s about to make a seemingly awful mistake by marrying a wealthy, boring man.'),
(523650, 1, 'Free Willy', '43831', 1993, '112', 'Ordered to clean up the graffiti he painted at a marine theme park, a troubled young boy unexpectedly bonds with a killer whale on exhibit.'),
(542137, 1, 'Gigi', '43770', 1958, '115', 'Gigi\'s an avant-garde French waif being groomed as the fille de joie of affluent and handsome Gaston. Soon Gigi metamorphoses into a stunning beauty.'),
(569355, 1, 'Hamburger Hill', '43792', 1987, '110', 'The Vietnam War\'s horrors come brutally to life through the eyes of American soldiers trying to take a heavily fortified hill under Vietcong control.'),
(607931, 1, 'How to Make an American Quilt', '43191', 1995, '116', 'A conflicted young woman spends the summer with her grandmother, her great-aunt and their quilting circle, whose life stories captivate her.'),
(653673, 1, 'Jimi Hendrix', '43770', 1973, '102', 'Jimi Hendrix\'s family, friends, and fellow musicians discuss his life and influence. Hendrix also appears in classic performance footage.'),
(673843, 1, 'Kingpin', '43831', 1996, '114', 'After a bowler loses his hand, his career takes a nosedive. That is, until he uncovers the next big thing: an Amish kid named Ishmael.'),
(684847, 1, 'The Last Boy Scout', '43770', 1991, '105', 'Private eye Joe Hallenbeck is forced to team up with a disgraced quarterback to uncover a conspiracy by a politician and a football team owner.'),
(699257, 1, 'Monty Python\'s Life of Brian', '43375', 1979, '94', 'Born in a stable in Judea, Brian grows up to join a group of anti-Roman zealots, but his fate keeps getting confused with that of a certain carpenter.'),
(701346, 1, 'Like Water for Chocolate', '43770', 1992, '105', 'When Pedro marries her sister, Tita throws herself into her cooking – and discovers she can transfer her emotions through the food she prepares.'),
(709163, 1, 'Logan\'s Run', '43770', 1976, '118', 'In the 23rd century, inhabitants of a domed city exist in a world filled with life\'s pleasures – but no one is allowed to live past the age of 30.'),
(709380, 1, 'Lolita', '43770', 1962, '153', 'In this black comedy, an English professor marries his landlady to get closer to his forbidden obsession: her teenage daughter.'),
(771476, 1, 'Monty Python and the Holy Grail', '43467', 1975, '92', 'The Monty Python comedy clan skewers King Arthur and his Knights of the Round Table as they quest far and wide for the Holy Grail.'),
(786137, 1, 'My Girl', '43831', 1991, '102', 'This coming-of-age charmer follows a summer in the life of an 11-year-old girl who learns about love and loss as she grapples with profound changes.'),
(793907, 1, 'The Natural', '43831', 1984, '138', 'A gifted baseball player whose life has taken some startling turns becomes a 35-year-old rookie who helps a cellar-dwelling team get back in the game.'),
(846071, 1, 'Patriot Games', '43831', 1992, '117', 'CIA desk jockey Jack Ryan plunges into the heart of international terrorism after spoiling an assassination attempt on a British royal family member.'),
(848915, 1, 'The Pelican Brief', '43770', 1993, '141', 'When law student Darby Shaw theorizes about the assassinations of two Supreme Court justices, she is put in danger and turns to a reporter for help.'),
(855084, 1, 'Philadelphia', '43647', 1993, '126', 'Philadelphia attorney Andrew Beckett launches a wrongful termination suit against his law firm when they fire him because he\'s gay and HIV-positive.'),
(873159, 1, 'Primal Fear', '43800', 1996, '131', 'When a blood-spattered altar boy is found running from a murder scene, his conviction seems certain – but his attorney is determined to win the case.'),
(880640, 1, 'Pulp Fiction', '43466', 1994, '154', 'This stylized crime caper weaves together stories featuring a burger-loving hit man, his philosophical partner and a washed-up boxer.'),
(896678, 1, 'Red Dawn', '43830', 1984, '114', 'A group of teenagers witnesses Soviet and Cuban paratroopers descending on their small Colorado town and systematically setting off World War III.'),
(907090, 1, 'Richard Pryor: Live in Concert', '42705', 1979, '79', 'Richard Pryor\'s classic 1979 concert film has him discussing a wide range of topics, including race, the police and his favorite target – himself.'),
(915927, 1, 'Rocky', '43678', 1976, '120', 'Sylvester Stallone shot to fame as Rocky Balboa, an unknown fighter who\'s given a shot at fighting world champ Apollo Creed as a publicity stunt.'),
(916043, 1, 'Rocky II', '43678', 1979, '119', 'Featuring a rousing climax, this engaging sequel finds boxer Rocky Balboa returning to the ring for a rematch against reigning champ Apollo Creed.'),
(916061, 1, 'Rocky IV', '43678', 1985, '92', 'Rocky Balboa takes on the Cold War, coming out of retirement to battle a Soviet fighter who pulverized Rocky\'s friend and former rival, Apollo Creed.'),
(923574, 1, 'Rumble in the Bronx', '43770', 1995, '89', 'During a visit to the Bronx to help out at his uncle\'s store, a cheerful martial arts expert springs into action when a gang terrorizes the shop.'),
(973861, 1, 'Sling Blade', '43770', 1996, '135', 'A man returns home after being released from a psychiatric hospital, where he\'d been confined since age 12 for murdering his mother and her lover.'),
(1005494, 1, 'The Stranger', '43300', 1946, '94', 'A Nazi fugitive hiding in Connecticut tries to keep his identity hidden from his naïve new wife while a dogged investigator pursues him relentlessly.'),
(1008581, 1, 'Stripes', '43709', 1981, '106', 'After losing everything, an indolent sad sack impulsively joins the U.S. Army and cajoles his best friend into enlisting, too.'),
(1029730, 1, 'Teenage Mutant Ninja Turtles: The Movie', '43831', 1990, '94', 'After exposure to a strange, glowing ooze, four mutant turtles train as ninjas in the sewers and fight crime wherever they find it.'),
(1064058, 1, 'Tremors 2: Aftershocks', '43831', 1995, '100', 'A rag-tag team of survivalists and scientists battle supersucking desert creatures that are worming their way through the oil fields of Mexico.'),
(1065372, 1, 'The Trigger Effect', '43101', 1996, '94', 'When a power failure throws their suburban town into chaos, Matthew and his wife stoop to desperate measures to secure medication for their child.'),
(1067876, 1, 'True Grit', '43831', 1969, '128', 'Teenage tomboy Mattie Ross enlists the help of crusty lawman Rooster Cogburn to track down the hired hand who murdered her father.'),
(1145882, 1, 'Young Tiger', '42675', 1973, '81', 'Aided only by a tough female police officer, a Hong Kong taxi driver tries to escape from gangsters pursuing incriminating evidence left in his cab.'),
(1150871, 1, 'Love Jones', '43770', 1997, '109', 'In this urban romantic comedy set in Chicago, the ups and downs of courtship play out between a young black poet and a pretty shutterbug.'),
(1151188, 1, 'Chasing Amy', '43831', 1997, '113', 'Comic book artist Holden meets the perfect woman, only to learn that she\'s a lesbian. But that doesn\'t stop him from falling in love with her.'),
(1151375, 1, 'Dante\'s Peak', '43709', 1997, '108', 'When a volcanologist comes to investigate the recent rumblings of a dormant volcano, a massive eruption has everyone in town fighting for their lives.'),
(1151721, 1, 'Donnie Brasco', '43831', 1997, '127', 'When FBI agent Joe Pistone goes undercover to infiltrate the mob, he starts to identify with the made men he\'s charged with taking down.'),
(1153194, 1, 'The Saint', '43709', 1997, '116', 'Hired by a Russian politician to steal the formula for cold fusion, master thief Simon Templar falls for the scientist who has unlocked the secret.'),
(1153656, 1, 'Austin Powers: International Man of Mystery', '43800', 1997, '90', 'A swingin\' fashion photographer by day and a groovy British secret agent by night, superspy Austin Powers must foil the sinister schemes of Dr. Evil.'),
(1171655, 1, 'Bean: The Ultimate Disaster Movie', '43313', 1997, '89', 'Disaster-prone Mr. Bean is sent to Los Angeles to guard a famous painting, but as he\'s unfit for any physical task, everything goes hilariously wrong.'),
(1178866, 1, 'The Game', '43770', 1997, '129', 'Nicholas receives an unusual birthday present from his brother, Conrad – a gift certificate to play a unique kind of game formulated by \"CRS.\"'),
(1179333, 1, 'How to Be a Player', '43770', 1997, '94', 'Dray lives life one woman at a time and is the envy of all his friends, until his sister decides to show him the error of his philandering ways.'),
(1179574, 1, 'Event Horizon', '43831', 1997, '96', 'After a signal is received from a long-missing spaceship, a rescue ship investigates, but the crew soon realizes something unimaginable has happened.'),
(1179583, 1, 'Money Talks', '43770', 1997, '96', 'TV news reporter James Russell helps put small-time criminal Franklin Hatchett in jail, but turns to protecting Hatchett when he escapes from prison.'),
(1180086, 1, 'Kiss the Girls', '43831', 1997, '116', 'A forensic psychologist teams up with an escaped kidnapping victim to hunt down a serial killer who abducts and dominates strong-willed women.'),
(1181488, 1, 'As Good as It Gets', '43831', 1997, '139', 'The structured world of a sour, obsessive-compulsive author crumbles when he\'s drawn into the lives of a stressed-out single mom and his gay neighbor.'),
(1181550, 1, 'Scream 2', '43739', 1997, '121', 'Gale has written a best-seller which has been turned into a film. As the movie premiere looms closer, the mysterious deaths begin again.'),
(1181661, 1, 'The Rainmaker', '43789', 1997, '136', 'A young attorney and a scrappy paralegal work to help the parents of a terminally ill boy in their suit against an insurance company.'),
(1192866, 1, 'Fallen', '43770', 1998, '124', 'A tough homicide cop faces his most dangerous assignment when he must stop a murderous evil spirit who can move from one host to the next.'),
(1193180, 1, 'Kurt & Courtney', '43473', 1998, '95', 'This film charts Nirvana\'s Kurt Cobain\'s rise to fame, his drug-addled romance with Courtney Love and the conspiracy theories surrounding his death.'),
(5670479, 1, 'The Mask of Zorro', '43831', 1998, '138', 'An aging Zorro passes the torch to a young successor, schooling him in discipline and training him to take up the sword against crooked officials.'),
(11546798, 1, 'Lifeline', '43328', 1997, '104', 'Johnnie To\'s character-centered drama follows a Hong Kong firefighting crew as they take on harrowing rescue missions and navigate personal dilemmas.'),
(11819434, 1, 'Fear and Loathing in Las Vegas', '43770', 1998, '118', 'A sportswriter and his Samoan lawyer embark on a hallucinogenic three-day romp from Los Angeles to Las Vegas in this counterculture cult favorite.'),
(11819467, 1, 'Godzilla', '43831', 1998, '139', 'A team of experts – including a biologist and two scientists – must stop an oversized lizard from destroying all of Manhattan.'),
(15815343, 1, 'The Texas Chainsaw Massacre', '43760', 1974, '83', 'When some friends visit a vandalized graveyard, they come upon a chainsaw-wielding maniac, and it\'s a fight to the bloody death between good and evil.'),
(16914787, 1, 'BASEketball', '43405', 1998, '103', 'When two slackers\' made-up sport, BASEketball, becomes a national craze, they hope to cash in on the basketball/baseball hybrid\'s popularity.'),
(16944044, 1, 'Lock, Stock and Two Smoking Barrels', '43466', 1998, '108', 'Hoping to make a bundle in a high-stakes poker game, four shiftless lads from London\'s East End instead find themselves swimming in debt.'),
(17016471, 1, 'Tomorrow Never Dies', '43830', 1997, '119', 'Pierce Brosnan stars in this 007 installment, which teams the secret agent and a sexy Chinese superspy against a megalomaniacal media mogul.'),
(17236920, 1, 'Rounders', '43770', 1998, '121', 'A law student befriends and \"befoes\" a fellow gambling addict and a club owner, and tensions run high when they must come up with $15k in just 5 days.'),
(17457622, 1, 'Judwaa', '43830', 1997, '133', 'Separated at birth, a pair of identical twins unexpectedly reunite as adults and embark on a madcap mission to take down a common enemy from their past.'),
(17457962, 1, 'Raja Hindustani', '42856', 1996, '177', 'When a poor taxi driver falls in love with a wealthy young woman, he must stand up to her family and contend with his own insecurities.'),
(17671454, 1, 'Dil Se', '43160', 1998, '166', 'A radio broadcaster\'s intense attraction to a mysterious woman opens the door to a tidal wave of powerful emotions and desires.'),
(17672040, 1, 'The River Wild', '43344', 1994, '111', 'A turbulent vacation turns deadly when a fugitive and his crew kidnap a river rafting guide and her family, forcing them down the dangerous river.'),
(17687959, 1, 'The Waterboy', '42802', 1998, '90', 'A water boy for a college football team has a rage that makes him a tackling machine whose bone-crushing power might vault his team into the playoffs.'),
(17969262, 1, 'Khalnayak', '43160', 1993, '170', 'A prison guard goes undercover as a dancer to try and recapture an escaped criminal and restore her police inspector boyfriend\'s reputation.'),
(18002692, 1, 'American History X', '43770', 1998, '119', 'A neo-Nazi gets sent to prison for murder and comes out a changed man. But can he prevent his younger brother from following in his footsteps?'),
(18021979, 1, 'The Rugrats Movie', '43739', 1998, '81', 'When his baby brother Dil is born, Tommy Pickles and his pals decide that he\'s too much responsibility and try to return him to the hospital.'),
(18066997, 1, 'A Night at the Roxbury', '43800', 1998, '82', 'After a run-in with Richard Grieco, dimwits Doug and Steve gain entry to a swanky nightclub in this comedy based on a \"Saturday Night Live\" sketch.'),
(18907685, 1, 'Taxi Driver', '43647', 1976, '114', 'Enraged by New York\'s moral rot and urban decay, an unhinged cab driver goes mad, plotting an assassination and saving a teen sex worker.'),
(19207412, 1, 'Maine Pyar Kiya', '43101', 1989, '192', 'When the son of a wealthy businessman and the daughter of a struggling engineer fall in love, the young man\'s parents question the girl\'s motives.'),
(20077944, 1, 'Ghayal', '43830', 1990, '163', 'Framed for his older brother\'s murder, a boxer seeks violent revenge against the true killer who\'s torn his family apart.'),
(20129240, 1, 'Small Soldiers', '43617', 1998, '110', 'When the Commando Elite, a group of toy action figures, are released before they\'ve been tested, they attack the children playing with them.'),
(20159719, 1, 'The Peacemaker', '43831', 1997, '124', 'After terrorists trigger a nuclear blast in Russia, a U.S. Special Forces intelligence agent and a nuclear weapons expert come to the rescue.'),
(20254278, 1, 'Aakhri Adaalat', '42979', 1988, '148', 'An intrepid police inspector forced into a desk job must take matters into his own hands when ruthless criminals are released on a technicality.'),
(20255593, 1, 'Chupke Chupke', '43830', 1975, '127', 'Jealous of the high regard in which his new wife holds their brother-in-law, a botany professor stages an elaborate prank that will even the score.'),
(20255837, 1, 'Don', '43830', 1978, '158', 'A man who\'s a lookalike for a slain mob kingpin is asked by the police to impersonate the gangster and infiltrate his underworld organization.'),
(20257393, 1, 'Professor', '42917', 1962, '163', 'A college grad in need of money must disguise himself as an old man to tutor two young women who are under the watchful eye of their strict aunt.'),
(20257617, 1, 'Satte Pe Satta', '43830', 1982, '153', 'The eldest of seven brothers who run a family farm together marries a pretty nurse, inspiring his country-bumpkin siblings to follow his example.'),
(20258084, 1, 'Andaz Apna Apna', '43236', 1994, '160', 'Broke and with no concrete plans for the future, two young men discover that a stunning heiress lives nearby and try to charm her into marriage.'),
(20557937, 1, 'The Matrix', '43770', 1999, '136', 'A computer hacker learns that what most people perceive as reality is actually a simulation created by machines, and joins a rebellion to break free.'),
(20705133, 1, 'Ghulam-E-Musthafa', '43830', 1997, '161', 'Giving up his life of crime for love, a gangster struggles with a moral dilemma when tragic events and enduring enemies take him back to the underworld.'),
(20712279, 1, 'Kaalia', '43830', 1981, '173', 'Jailed for robbing his brother’s unscrupulous employer, a simpleton has a transformation while in prison, emerging with a violent mission for revenge.'),
(20717860, 1, 'Trimurti', '43160', 1995, '173', 'After being framed, a policewoman languishing in prison hopes that her three sons will deliver justice and restore her honor.'),
(20764666, 1, 'English Babu Desi Mem', '42856', 1996, '163', 'After his brother dies, wealthy Vikram reluctantly returns to India and forms a surprise bond with his orphaned nephew and the showgirl raising him.'),
(20765027, 1, 'Hera Pheri', '43830', 1976, '156', 'The bond between two crooks and best friends is threatened when one learns that the other\'s father had a hand in his own tragic past.'),
